INSERT INTO "public"."faqs" ("id", "created_at", "question", "answer", "language", "order") VALUES
	(1, '2024-05-12 16:05:52.860546+00', 'How do I purchase drink tickets for the event?', 'Simply navigate to the event page, select your desired drinks, and proceed to checkout to purchase tickets.', 'en', 1),
	(2, '2024-05-12 16:06:11.430373+00', 'What is the process for redeeming purchased tickets at the event?', 'Present a purchased ticket (found on the wallet section) to the bartender at the event to redeem your drink.', 'en', 2),
	(3, '2024-05-12 16:06:26.585804+00', 'How do I add an event to my events following list?', 'Scan the QR code found at posters around the event venue to automatically add it to your following list.', 'en', 3),
	(4, '2024-05-12 16:06:47.550019+00', 'Can I view my transaction history and purchase invoices?', 'Yes, you can view your transaction history and generate invoices for each purchase within the profile section.', 'en', 4),
	(5, '2024-05-12 16:07:07.225204+00', 'What should I do if I have unused tickets after the event has finished?', 'Unfortunately, unused tickets are non-refundable.', 'en', 5),
	(6, '2024-05-12 16:07:25.980392+00', '¿Cómo puedo comprar tickets de bebida para el evento?', 'Simplemente ve a la página del evento, selecciona las bebidas deseadas y procede al pago para comprar los tickets.', 'es', 1),
	(7, '2024-05-12 16:07:43.715509+00', '¿Cuál es el proceso para canjear los tickets comprados en el evento?', 'Presenta un ticket comprado (encontrado en la sección wallet) en la barra del evento para canjear tu bebida.', 'es', 2),
	(8, '2024-05-12 16:07:59.825671+00', '¿Cómo puedo agregar un evento a mi lista de eventos seguidos?', 'Escanea el código QR de los carteles en el evento para agregarlo automáticamente a tu lista de seguidos.', 'es', 3),
	(9, '2024-05-12 16:08:18.490784+00', '¿Puedo ver mi historial de transacciones y facturas de compra?', 'Sí, puedes ver tu historial de transacciones y generar facturas para cada compra dentro de la sección del perfil.', 'es', 4),
	(10, '2024-05-12 16:08:35.625903+00', '¿Qué debo hacer si tengo tickets sin usar después de que termine el evento?', 'Desafortunadamente, los tickets sin usar no son reembolsables.', 'es', 5),
	(11, '2024-05-12 16:08:52.760019+00', 'Com puc comprar tickets de beguda per a l''esdeveniment?', 'Simplement ves a la pàgina de l''esdeveniment, selecciona les begudes desitjades i procedeix al pagament per comprar els tickets.', 'ca', 1),
	(12, '2024-05-12 16:09:09.395136+00', 'Quin és el procés per a bescanviar els tickets comprats a l''esdeveniment?', 'Presenta un ticket comprat (trobat a la secció wallet) a la barra de l''esdeveniment per a bescanviar la teva beguda.', 'ca', 2),
	(13, '2024-05-12 16:09:26.530255+00', 'Com puc afegir un esdeveniment a la meva llista de seguiment d''esdeveniments?', 'Escaneja el codi QR trobat als cartells al voltant del lloc de l''esdeveniment per afegir-lo automàticament a la teva llista de seguiment.', 'ca', 3),
	(14, '2024-05-12 16:09:43.665372+00', 'Puc veure el meu historial de transaccions i factures de compra?', 'Sí, pots veure el teu historial de transaccions i generar factures per a cada compra dins de la secció del perfil.', 'ca', 4),
	(15, '2024-05-12 16:10:00.800489+00', 'Què he de fer si tinc tickets sense utilitzar després que acabi l''esdeveniment?', 'Desafortunadament, els tickets sense utilitzar no són reemborsables.', 'ca', 5);
